/**
 * 1로 만들기
 *  1 <= x <= 30,000
 */

function makeIt1(x) {
  const arr = new Array(x + 1).fill(0);

  for (let i = 2; i < x + 1; i++) {
    console.log(i);
  }
}

export default { makeIt1 };
